How to populate mongoose with obejectId which is defined as Number?<p>I'm trying to populate my user requests.profileId but it returns only nulls.</p>
<p>I have the following schemas:</p>
<p>First Schema:</p>
<pre><code>const profileSchema = new mongoose.Schema({
  _id: { type: Number }, //&lt;- _id is defined as a number which represents mobile number (easier for me to handle)
  first: { type: String },
  second: { type: String },
});

module.exports = mongoose.model('Profile', profileSchema, 'profiles');
</code></pre>
<p>Second Schema:</p>
<pre><code>const userSchema = new mongoose.Schema({
  firstName: { type: String },
  lastName: { type: String },
  requests: [
    {
      profileId: {
        type: mongoose.Schema.Types.ObjectId,
        ref: 'Profile',
      },
      requestTime: { type: Date, default: Date.now },
    },
  ],
});

module.exports = mongoose.model('User', userSchema, 'users');
</code></pre>
<p>Here is my code:</p>
<pre><code>const user = await User.findById(req.user).populate('requests.profileId');
console.log(user.requests);
</code></pre>
<p>Here is the output:</p>
<pre><code>[
  {
    _id: 6201633869648e2b74c00a10,
    profileId: null,
    requestTime: 2022-02-07T18:21:44.722Z
  },
  {
    _id: 6201633b69648e2b74c00a11,
    profileId: null,
    requestTime: 2022-02-07T18:21:47.238Z
  },
  {
    _id: 620238f9d2b5dd3dee6c41a2,
    profileId: null,
    requestTime: 2022-02-08T09:33:45.176Z
  },
  {
    _id: 620239253220343dfd7cfdd9,
    profileId: null,
    requestTime: 2022-02-08T09:34:29.780Z
  }
]
</code></pre>
<p>Here is the output without populate:</p>
<pre><code>[
  {
    _id: 6201633869648e2b74c00a10,
    profileId: 393732353235303134343330, //&lt;- typeof profileId is obeject
    requestTime: 2022-02-07T18:21:44.722Z
  },
  {
    _id: 6201633b69648e2b74c00a11,
    profileId: 393732353435353333313131,
    requestTime: 2022-02-07T18:21:47.238Z
  },
  {
    _id: 620238f9d2b5dd3dee6c41a2,
    profileId: 393732353435353333313131,
    requestTime: 2022-02-08T09:33:45.176Z
  },
  {
    _id: 620239253220343dfd7cfdd9,
    profileId: 393732353435353333313131,
    requestTime: 2022-02-08T09:34:29.780Z
  }
]
</code></pre>
<p>Currently Profile.findById(mobileNumber) works fine.</p>
<p>Any ideas what went wrong?</p>
<p>Will greatly appreciate your assistance.</p>
<p>Thanks in advance :)</p>

