How to get a previous value after a mongo unwind<h1>Is it possible to access the previous document after an <code>$unwind</code> and then <code>$group</code> them together in the new (cleaned up) object?</h1>
<p>Using this Mongo <code>aggregate</code>: <a href="https://mongoplayground.net/p/IsM-h9DnhjJ" rel="nofollow noreferrer">mongoplayground.net/p/IsM-h9DnhjJ</a> I would like to get an average of all result <code>stats</code> and <code>scores</code> within a page, then an average of all the pages stats for a site.</p>
<h2>Collections</h2>
<p>I have three collections that are all related. Site &gt; Page &gt; Result (page result)</p>
<pre class="lang-json prettyprint-override"><code>// sites
{
  _id: &quot;si-site-a&quot;,
  teamId: &quot;te-team-1&quot;,
  name: &quot;Site a&quot;
}
</code></pre>
<pre class="lang-json prettyprint-override"><code>// pages
{
  _id: &quot;pa-page-a&quot;,
  teamId: &quot;te-team-1&quot;,
  siteId: &quot;si-site-a&quot;,
  name: &quot;Page A&quot;,
  status: &quot;ok&quot;
},
{
  _id: &quot;pa-page-b&quot;,
  teamId: &quot;te-team-1&quot;,
  siteId: &quot;si-site-a&quot;,
  name: &quot;Page B&quot;,
  status: &quot;ok&quot;
}
</code></pre>
<pre class="lang-json prettyprint-override"><code>// results
{
  _id: &quot;re-result-1&quot;,
  pageId: &quot;pa-page-a&quot;,
  siteId: &quot;si-site-a&quot;,
  results: {
    scores: {
      performance: 0.75,
      accessibility: 0.98,
      &quot;best-practices&quot;: 0.93,
      seo: 1,
      pwa: 0.36,
      ecoscore: 0.94
    },
    stats: {
      transferSize: 876995,
      co2grams: 0.11,
      pageLoadTime: 1722.284
    }
  },
  region: &quot;gb1&quot;,
  timestamp: ISODate(&quot;2022-02-05T16:38:35.454Z&quot;),
  status: &quot;ok&quot;
}
</code></pre>
<h2>Desired output</h2>
<pre class="lang-json prettyprint-override"><code>  {
    _id: 'a',
    name: 'Site a',
    pages: [
      {
        _id: 'aa',
        name: 'Page a',
        status: 'ok',
        resultAverages: {
          ecoscore: 0.89,
          transferSize: 556081,
          co2grams: 0.19,
          pageLoadTime: 1011.7159999999999,
        },
      },
    ],
    pageAverages: {
          ecoscore: 0.89,
          transferSize: 556081,
          co2grams: 0.19,
          pageLoadTime: 1011.7159999999999,
    },
    comparedTo: {
          ecoscore: 0.89,
          transferSize: 556081,
          co2grams: 0.19,
          pageLoadTime: 1011.7159999999999,
    },
    percentageChange: {
          ecoscore: 0,
          transferSize: 0,
          co2grams: -0.19,
          pageLoadTime: 0.24,
    },

  },
</code></pre>

