Get last conversations as admin in mongodb<p>I have a Learning Management System (LMS) where students can ask/chat with admins for each lesson.</p>
<p>As an Admin, I want to get last unseen chats from all lessons sorted by createdAt &amp; seenByAdmin from dashboard.</p>
<p>Here's my Message Model:</p>
<pre class="lang-js prettyprint-override"><code>{
  studentId: {
    type: mongoose.Schema.Types.ObjectId,
    ref: &quot;Student&quot;
  },
  lessonId: {
    type: mongoose.Schema.Types.ObjectId,
    ref: &quot;Lesson&quot;
  },
  from: {
    type: String,
    enum: [&quot;student&quot;, &quot;admin&quot;]
  },
  content: {
    type: String
  },
  seenByAdmin: {
    type: Boolean,
    default: false
  },
  createdAt: {
    type: Date,
    default: Date.now()
  }
}
</code></pre>
<p>A you can see I don't care which admin is replying to the student.</p>
<p>My desired output:</p>
<pre class="lang-js prettyprint-override"><code>[
{
  lessonId: ObjectID,
  chats: [
    {
       studentId: ObjectID,
       createdAt: Date, /* of last message */
       seenByAdmin: Boolean, /* of last message */
       content: String /* content of last message (optional) */
    }
  ]
},
{
  lessonId: ObjectID,
  chats: [
    {
       studentId: ObjectID,
       createdAt: Date, /* of last message */
       seenByAdmin: Boolean, /* of last message */
       content: String /* content of last message (optional) */
    },
    {
       studentId: ObjectID,
       createdAt: Date, /* of last message */
       seenByAdmin: Boolean, /* of last message */
       content: String /* content of last message (optional) */
    }
  ]
}
]
</code></pre>
<p><strong>OR</strong></p>
<pre class="lang-js prettyprint-override"><code>[
  {
    lessonId: ObjectID,
    studentId: ObjectID,
    createdAt: Date, /* of last message */
    seenByAdmin: Boolean, /* of last message */
    content: String /* content of last message (optional) */
  },
  {
    lessonId: ObjectID,
    studentId: ObjectID,
    createdAt: Date, /* of last message */
    seenByAdmin: Boolean, /* of last message */
    content: String /* content of last message (optional) */
  }
]
</code></pre>
<p>I have been stuck on writing a mongodb aggregation/query and I would appreciate any help!</p>

